import React, { lazy, Suspense } from 'react';
import { Link } from 'react-router-dom';
import '../styles/FeaturedProperties.css';
import '../styles/PropertyCard.css';
import '../styles/Testimonials.css';
import '../styles/ContactSection.css';
import '../styles/HomePage.css';

const FeaturedProperties = lazy(() => import('../components/FeaturedProperties'));
const Testimonials = lazy(() => import('../components/Testimonials'));
const ContactSection = lazy(() => import('../components/ContactSection'));

function HomePage() {
  return (
    <div className="home-page">
      <section className="hero">
        <div className="hero-content">
          <h1>Find Your Dream Property</h1>
          <p>Discover the perfect home with our curated selection</p>
          <Link to="/properties" className="cta-button">Explore Now</Link>
        </div>
      </section>
      
      <Suspense fallback={<div className="loading-spinner">Loading...</div>}>
        <FeaturedProperties />
        <Testimonials />
      </Suspense>

      <section id="contact">
        <ContactSection />
      </section>
    </div>
  );
}

export default HomePage;
